import React from "react";
import './EuropeTimeline.css'

export default function EuropeTimeline(){
    return(
        <>
            <div className="timeline">
                <h1 className="title">
                    Europe
                </h1>
                <div className="verticalLine"/>
            </div>
        </>
    );
}
